DELIMITER $$

-- khi thêm hóa đơn
CREATE TRIGGER update_tong_tien_after_insert_update
AFTER INSERT ON ChiTietHoaDonNhap
FOR EACH ROW
BEGIN
    UPDATE HoaDonNhap
    SET TongTien = (SELECT SUM(SoLuong * GiaNhap) 
                    FROM ChiTietHoaDonNhap 
                    WHERE IDHoaDonNhap = NEW.IDHoaDonNhap)
    WHERE IDHoaDonNhap = NEW.IDHoaDonNhap;
END $$

-- khi sửa hóa đơn
CREATE TRIGGER update_tong_tien_after_update
AFTER UPDATE ON ChiTietHoaDonNhap
FOR EACH ROW
BEGIN
    UPDATE HoaDonNhap
    SET TongTien = (SELECT SUM(SoLuong * GiaNhap) 
                    FROM ChiTietHoaDonNhap 
                    WHERE IDHoaDonNhap = NEW.IDHoaDonNhap)
    WHERE IDHoaDonNhap = NEW.IDHoaDonNhap;
END $$

-- khi xóa hóa đơn
CREATE TRIGGER update_tong_tien_after_delete
AFTER DELETE ON ChiTietHoaDonNhap
FOR EACH ROW
BEGIN
    UPDATE HoaDonNhap
    SET TongTien = (SELECT COALESCE(SUM(SoLuong * GiaNhap), 0) 
                    FROM ChiTietHoaDonNhap 
                    WHERE IDHoaDonNhap = OLD.IDHoaDonNhap)
    WHERE IDHoaDonNhap = OLD.IDHoaDonNhap;
END $$

DELIMITER ;

